 # See Branicky link for translation of Knuth's CWEB program.
from math import isqrt
def A368207(n):
    c, r = 0, isqrt(n)
    for w in range(r+1):
        for x in range(w,r+1):
            wx = w*x
            if wx>n:
                break
            for y in range(x+1,r+1):
                for z in range(y,n+1):
                    yz = wx+y*z
                    if yz>n:
                        break
                    if yz==n:
                        m = 1
                        if w!=x:
                            m<<=1
                        if y!=z:
                            m<<=1
                        c+=m
    return c # _Chai Wah Wu_, Dec 19 2023
from sympy import divisors
# faster program
def A368207(n):
    c = 0
    for d2 in divisors(n):
        if d2**2 > n:
            break
        c += (d2<<2)-2 if d2**2<n else (d2<<1)-1
    for wx in range(1,(n>>1)+1):
        for d1 in divisors(wx):
            if d1**2 > wx:
                break
            for d2 in divisors(m:=n-wx):
                if d2**2 > m:
                    break
                if wx < d1*d2:
                    k = 1
                    if d1**2 != wx:
                        k <<=1
                    if d2**2 != m:
                        k <<=1
                    c+=k
    return c # _Chai Wah Wu_, Dec 19 2023

